import React from 'react';
import Loader from "react-loader-spinner";

export default function LoadingSpinner() {
  return (
    <div>
        <Loader
            type="Puff"
            color="#00BFFF"
            height={100}
            width={100}
            timeout={3000}
        />
    </div>
  )
}
